import React from 'react';

function ClienteGrid({ datosDelFormulario }) {
    // Utiliza los datos del formulario en tu tabla
    return (
        <table >
            <thead>
                <tr>
                    <th scope="col">Expediente</th>
                    <th scope="col">Tipo cliente</th>
                    <th scope="col">Nombre cliente</th>
                    <th scope="col">Nombre asegurado</th>
                    <th scope="col">NSS</th>
                    <th scope="col">CURP</th>
                    <th scope="col">RFC</th>
                    <th scope="col">Email</th>
                    <th scope="col">Telefono</th>
                    <th scope="col"></th>
                    <th scope="col"></th>
                </tr>
            </thead>
        </table>
    );
}

export default ClienteGrid;
